import React from 'react';
import './App.css';
import { Container, Row, Col, Button, Card, CardImg, CardBody, CardTitle, CardSubtitle, CardText, Badge } from 'reactstrap';
import Header from './components/Header'

function App() {
  return (
    <Container>
      <Header/>
      <Row>
        <Col sm={6} md={4} className="mb-3">
          <Card>
            <CardImg width="100%" src="https://fakeimg.pl/318x180/" alt="Card image cap" />
            <CardBody>
              <CardTitle>商品名稱</CardTitle>
              <CardSubtitle>
                <h4><Badge color="success">售價：1000</Badge></h4>
              </CardSubtitle>
              <CardText>商品描述</CardText>
              <Button color="secondary">購買</Button>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
